import React from 'react';

interface WaveTideData {
  location: string;
  wave_height: string;
  tide_height: string;
  // Add other properties as needed
}

interface WavesTideInfoProps {
  wavesTideData: WaveTideData;
}

const WavesTideInfo: React.FC<WavesTideInfoProps> = ({ wavesTideData }) => {
  return (
    <div>
      <h2>Waves & Tide Information for {wavesTideData.location}</h2>
      <p>Wave Height: {wavesTideData.wave_height}</p>
      <p>Tide Height: {wavesTideData.tide_height}</p>
      {/* Add other properties as needed */}
    </div>
  );
};

export default WavesTideInfo;
